​안녕 안녕 ​.토마토로 뭘 해볼까하다가선드라이 토마토 하기로 함어제 와인잔 사건으로두번 째 같은 노가다의 현장열탕소독 무섭 😨후라이팬에 찬물 붓고 유리병 넣고무서워서 약불에서 했는데그래서 시간이 더 걸림중불에 하시더라는..끓기시작하면 5분 더 끓이면서집게나 고무장갑 착용하고 유리병시간 차 두고 굴려주기​식초와 베이킹소다 물에 3분정도 담궈서휘이휘이 저어 줌물에 4번 씻음 ㅋ ㅋ ㅋ꼭지 제거하고반을 잘라서 세팅소금을 솔솔 뿌리고15분 이상 방치하면물 생기는데키친타월이나 종이호일로덮어서 살짝 눌러주면물기가 제거 되는데생략했음그래서 시간이 더 걸림 ㅋ ㅋ​바질 파슬리 솔솔 뿌려서에어프라시어로 쏘옥​1차 155도 15분​로즈마리 몇개 넣고 돌림.1차 돌리고 열어서 20초정도 식혀 줌​2차 에어프라이기 돌리는 동안리코타치즈 샐러드뚝딱 뿌려서 냠냠2차 100도  15분 3차 100도  20분4차 95도 10분타임 중간마다 20초 정도 열어서 식힘30초 정도 열어서 식히고식힘망 위에서 식혀 줌​두번 째 대추토마토 넣고빨리하려고  1차 160도에 시작 했더니세개 정도 갈색빛이 돌아서당황타지 않고 말리는 것이 관건기계와 토마토 크기마다 다름.은근 정성의 노가다.상황봐서 맞추는 센스 필요​1시간 식혀서열탕 소독 된 유리병에 담을 예정생각보다 집에 유리용기가 커서반정도 찰까싶은데 ..유리병에말린 토마토 깔고 마늘 깔고로즈마리 깔고이 과정을 반뵈해서 층 쌓음.​마지막에 올리브오일 아낌없이 다 잠기게 부어 줌레몬 넣으면 더 이쁠텐데 레몬즙 세방울 투하뚜껑 닫고 상온에서 하루 보관하고냉장고에 넣어서 먹기2주까지 먹을 수 있음우리 마론이 너무 착해요리나 청소 식사 등. 작업을 하면얌전히 한쪽에서 혹은 멀리서 지켜보거나잔다미안하고 너무 사랑스러움.냉장고에 넣어두면 올리브유 특성상하얗게 될 수 있는데실온에 먹을만큼 꺼내두면다시 돌아옴.한 동안 선드라이토마토 보류힘듦 ㅋ ㅋ ㅋ토마토 마리네이드 만들어야지토마토 까는 작업이 있긴한데간편함.나눠주려고 작은병도 샀는데야무진 꿈이었음이탈리아계의 태양초 같은정성과 인고의 시간선드라이 토마토 #요리 #만들어먹기 #선드라이토마토 #에어프라이어기로 만들기 남은 올리브유는 #허브올리브유  와인잔 사건으로 다음날 다시 만듦 #이탈리아계태양초#정성#토마토;

